import React from 'react'
import CartCard from './CartCard'

function Cart({ cart, products }) {
    const filterCart = products.filter((eachProduct) => cart.includes(eachProduct.id))
    const displayCart = filterCart.map((eachFilterProduct) => {
        return <CartCard key={eachFilterProduct.id} product={eachFilterProduct}/>
    })

    return (
        <div>
            {displayCart}
        </div>
    )
}

export default Cart
